        setAbout(preState=>!preState)
    }

    if(setAbout){
        aboutpage='このページの詳細です';
    }
return(
    <div>
    <button onClick={AboutClick}>
        About
    </button>
    {aboutpage}
    </div>
);

}
export default About;
